import { Component } from '@angular/core';

@Component({
  selector: 'app-sup-header',
  templateUrl: './sup-header.component.html',
  styleUrls: ['./sup-header.component.css']
})
export class SupHeaderComponent {

  constructor(){
  }

}

 <div class="container-fluid">
    <div class="row" >
        <div class="col col-lg-2" id="left">
            <img src="../../../assets/Img/icono-redes/APLogo.png" class="img-fluid">
        </div>
        <div class="col" id="center">
            <app-social-links></app-social-links>
        </div>
        <div class="col col-lg-2" id="right">
            <app-log-button></app-log-button>
        </div>
    </div>    
</div>
